import styled from "styled-components";

export const Wrap = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  align-items: center;
  > input {
    width: 340px;
    height: 25px;
    font-size: 16px;
    font-family: "Pretendard-Medium";
    color: #b7bcc6;
    border: 1px solid #b7bcc6;
    border-radius: 15px;
    padding: 12px 15px;
  }
`;
